import React from "react";

const MarketingPack = ({
  name,
  image,
  value,
  onClick,
  purchased,
  displayButton,
}) => {
  return (
    <div class="cardData">
      <img
        class="center"
        src={image}
        alt="marketing pic"
        width="120px"
        height="55px"
      ></img>
      <h5>{name}</h5>
      <p>Cost: {value}</p>
      {displayButton && (
        <button
          type="button"
          onClick={onClick}
          class="btn btn-primary"
          value={value}
          name={name}
        >
          Purchase
        </button>
      )}
      {purchased && <h4>Purchased</h4>}
    </div>
  );
};

export default MarketingPack;
